import React from 'react';
import './../css/App.css';

//<Lister items={[1,2,3]} />

function Lister(props) {

    const listItems = props.items.map((number) =>
        <li>{number}</li>
    );

    return <ul>{listItems}</ul>;
}

export default Lister;
